import './App.css';
import React, {useState, useEffect, useCallback} from 'react';
import GlobalStateProvider from './Store';
import TodoList from './components/TodoList';
import Cool from './components/Cool';

function App() {
  return (
    <GlobalStateProvider>
    <div className="todo-app">
      <TodoList />
    </div>
    </GlobalStateProvider>
  );
}

export default App;
